sparqlQueGG:
SELECT DISTINCT ?country WHERE {
  ?country a dbo:Country ;
           dct:subject dbc:Countries_in_Europe ;
           dbo:governmentType dbr:Constitutional_monarchy .
}

SELECT DISTINCT ?country WHERE {
  ?place a <http://dbpedia.org/ontology/Place> ;
         <http://dbpedia.org/ontology/country> ?country ;
         <http://dbpedia.org/ontology/cave> ?cave .
  {
    SELECT ?place WHERE {
      ?place <http://dbpedia.org/ontology/cave> ?cave
    } GROUP BY ?place HAVING (COUNT(?cave) > 2)
   }
}

SELECT ?uri WHERE {
  ?uri a <http://dbpedia.org/ontology/Place> ;
       <http://dbpedia.org/property/admittanceDate> ?admittanceDate ;
       FILTER regex(?uri, "http://dbpedia.org/resource/[^_]*_(U.S._state)")
} ORDER BY DESC(?admittanceDate) LIMIT 1

SELECT DISTINCT ?state WHERE {
    ?state rdf:type dbo:Place ;
           dbo:country dbr:United_States ;
           dbo:populationDensity ?populationDensity .
} ORDER BY DESC(?populationDensity) LIMIT 1

SELECT ?river WHERE {
 ?river a <http://dbpedia.org/ontology/River> ;
         <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/China> ;
         <http://dbpedia.org/ontology/length> ?length . 
} ORDER BY DESC(?length) LIMIT 1

SELECT DISTINCT ?city WHERE {
  ?city rdf:type dbo:City ;
        dbo:country dbr:Germany ;
        dbo:populationTotal ?population .
  FILTER (?population > 250000)
}

SELECT ?poet (COUNT(?book) as ?count) WHERE {
?poet a <http://dbpedia.org/ontology/Person> .
?book <http://dbpedia.org/ontology/author> ?poet .
?poet <http://dbpedia.org/ontology/occupation> <http://dbpedia.org/resource/Poetry> .
} GROUP BY ?poet ORDER BY DESC(?count) LIMIT 1

SELECT DISTINCT ?country WHERE {
  ?volcano a <http://dbpedia.org/ontology/Volcano> ;
            <http://dbpedia.org/ontology/country> ?country .
} GROUP BY ?country HAVING (COUNT(?volcano) > 10)

SELECT DISTINCT ?president ?start ?end WHERE {
  ?president rdf:type dbo:President;
    dbo:country dbr:United_States;
    dbo:termPeriod [ 
      dbo:startDate ?start;
      dbo:endDate ?end
    ]
  FILTER((?start > "2001-01-01"^^xsd:date) && (?end < "2021-12-31"^^xsd:date))
} ORDER BY ?start

SELECT DISTINCT ?uri WHERE { 
?uri a <http://dbpedia.org/ontology/Person> ; 
<http://dbpedia.org/ontology/parent> ?parent ;
<http://dbpedia.org/ontology/birthPlace> ?birthPlace ; 
<http://dbpedia.org/ontology/deathPlace> ?deathPlace . 
?parent a <http://dbpedia.org/ontology/Noble> ; 
<http://dbpedia.org/ontology/nobleTitle> <http://dbpedia.org/resource/Earl> ;
<http://dbpedia.org/property/country> <http://dbpedia.org/resource/England> . 
FILTER (?birthPlace = ?deathPlace) 
FILTER EXISTS {?uri <http://dbpedia.org/ontology/child> ?child}
}

SELECT DISTINCT ?player ?height WHERE { 
  ?player a <http://dbpedia.org/ontology/BasketballPlayer> ; 
           <http://dbpedia.org/ontology/height> ?height ;
           <http://dbpedia.org/property/league> <http://dbpedia.org/resource/National_Basketball_Association> .
  FILTER(?height != 0) 
} 
ORDER BY (?height)
LIMIT 1

SELECT DISTINCT ?actor ?website WHERE {
  ?show rdfs:label "Charmed"@en .
  ?show dbo:starring ?actor .
  ?actor dbo:website ?website
}

SELECT ?player WHERE {
  ?player dbo:league dbr:Premier_League .
  ?player dbo:birthDate ?birthDate .
} ORDER BY DESC(?birthDate) LIMIT 1

SELECT ?type (COUNT(?uri) AS ?count) WHERE {
  {
    SELECT DISTINCT ?uri WHERE {
      ?uri a <http://dbpedia.org/ontology/River> ;
      <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/South_Carolina> ;
    } 
  } UNION {
    SELECT DISTINCT ?uri WHERE {
      ?uri a <http://dbpedia.org/ontology/Lake> ;
      <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/South_Carolina> ;
    } 
  }
} GROUP BY ?type

SELECT DISTINCT ?country ?capital WHERE {
  ?country dct:subject dbc:Countries_in_Africa .
  ?country dbo:capital ?capital .
}

SELECT ?libro WHERE {
   ?libro a <http://dbpedia.org/ontology/Book> ;
   <http://dbpedia.org/ontology/numberOfPages> ?pages .
   } 
ORDER BY DESC(?pages)
LIMIT 1

SELECT DISTINCT ?uri ?webPage WHERE { 
  ?uri rdf:type dbo:Company ;
       dbo:numberOfEmployees ?employees ;
       foaf:homepage ?webPage .
  FILTER (?employees > 500000)
}
